import React, { useEffect, useState } from "react";
import api from "../services/api";

function DataList() {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await api.get("/data"); // Fetch data from backend
        console.log("Fetched data:", response.data); // Debugging to check the structure of the response
        if (Array.isArray(response.data)) {
          setData(response.data); // Set data if it's an array
        } else {
          console.error("Expected an array but received:", response.data);
          setError("Unexpected response format. Please contact support.");
        }
      } catch (err) {
        console.error("Error fetching data:", err);
        setError("Failed to fetch data");
      }
    };

    fetchData();
  }, []);

  if (error) return <p style={{ color: "red" }}>{error}</p>;

  return (
    <div>
      <h2>Data List</h2>
      {data.length === 0 ? (
        <p>No data available.</p> // Fallback when data is an empty array
      ) : (
        <ul>
          {data.map((item, index) => (
            <li key={index}>{item.name}</li> // Display each item's name
          ))}
        </ul>
      )}
    </div>
  );
}

export default DataList;
